function fearNotLetter(str) {
  const alphabet = 'abcdefghijklmnopqrstuvwxyz'.split('');
  const letters = str.split('')
  let i = alphabet.indexOf(letters[0])

  for(i; i < alphabet.length; i++) {
    if (letters.includes(alphabet[i]) === false) {
      return alphabet[i]
     } 
   } 
}

